import React, { useContext, useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import axios from "axios";
import "../styles/Dashboard.css";
import { UserCircle, Music, XCircle } from "lucide-react";
import { MusicContext } from "../context/MusicProvider"; // ‚úÖ Import Music Context

const Dashboard = () => {
  const { musicOn, setMusicOn } = useContext(MusicContext); // ‚úÖ Use Music Context
  const [showLevels, setShowLevels] = useState(false);
  const [showSettings, setShowSettings] = useState(false);
  const [selectedLevel, setSelectedLevel] = useState("");
  const [username, setUsername] = useState("");
  const [score, setScore] = useState(0);
  const navigate = useNavigate();

  useEffect(() => {
    const token = localStorage.getItem("token");
    const storedUsername = localStorage.getItem("username");

    if (!token) {
      navigate("/login");
    } else {
      setUsername(storedUsername);
      fetchUserScore(token);
    }
  }, [navigate]);

  const fetchUserScore = async (token) => {
    try {
      const res = await axios.get("http://localhost:5000/auth/user", {
        headers: { Authorization: token },
      });
      setScore(res.data.score);
    } catch (error) {
      console.error("Error fetching user score", error);
    }
  };

  const toggleMusic = () => {
    const newMusicState = !musicOn;
    setMusicOn(newMusicState);
    localStorage.setItem("music", newMusicState ? "on" : "off");
  };

  return (
    <div className="Dbody">
      {showSettings && <div className="overlay active"></div>}

      <div className="SignContainer">
        <div className="overlayD">
          <div className="profile-icon" style={{ position: "absolute", top: "20px", right: "50px" }}>
            <UserCircle size={40} />
          </div>
          <p className="un" style={{ fontSize: "14px", marginTop: "5px" }}>{username}</p>

          <div className="dashboard-container">
            <h2>Welcome, {username || "Player"}!</h2>
            <h2>Your Current Score: {score} üèÜ</h2>

            <div className="menu">
              <button className="buttonss" onClick={() => navigate("/leaderboard")}>
                LEADERBOARD
              </button>
              <button className="buttonss" onClick={() => navigate("/game")}>
                PLAY GAME
              </button>
              <button className="buttonss" onClick={() => setShowSettings(true)}>
                SETTINGS
              </button>
              <button className="buttonss" onClick={() => navigate("/login")}>
                QUIT GAME
              </button>
            </div>

            {showSettings && (
              <div className="settings-overlay">
                <div className="settings-container">
                  <button className="close-settings" onClick={() => setShowSettings(false)}>
                    <XCircle size={30} color="red" />
                  </button>
                  <h3>Settings</h3>
                  <div className="music-toggle">
                    <Music size={30} style={{ marginRight: "10px" }} />
                    <button className="toggle-button" onClick={toggleMusic}>
                      {musicOn ? "Music: ON üéµ" : "Music: OFF üîá"}
                    </button>
                  </div>
                </div>
              </div>
            )}
          </div>
        </div>
      </div>
    </div>
  );
};

export default Dashboard;
